import React from 'react';
import './App.css';
import DataVisualization from './components/DataVisualization';
import { ThemeProvider } from '@mui/material/styles';
import theme from './theme/theme';
import CssBaseline from '@mui/material/CssBaseline';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';
import Paper from '@mui/material/Paper';
import MapComponent from './components/MapComponent';
import DemographicsPieChart from './components/DemographicsPieChart';

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Box sx={{ flexGrow: 1 }}>
        <AppBar position="static" className="appBar">
          <Toolbar>
            <Typography variant="h5" component="div" sx={{ flexGrow: 1 }}>
              Welcome to Nest Quest
            </Typography>
          </Toolbar>
        </AppBar>
      </Box>
      <div className="hero-section">
        <Typography variant="h3">Explore. Discover. Decide.</Typography>
        <Typography variant="subtitle1">
          Dive into the world of locale data and make informed decisions with
          Nest Quest.
        </Typography>
      </div>
      <Container maxWidth="lg">
        <Box my={4}>
          <Paper>
            <Box>
              <DataVisualization
              />
            </Box>
            <MapComponent />
            <DemographicsPieChart />
          </Paper>
        </Box>
      </Container>
      <Box mt={5} py={3} className="footer">
        <Container maxWidth="lg">
          <Typography variant="body1">Nest Quest Â©2024</Typography>
        </Container>
      </Box>
    </ThemeProvider>
  );
}

export default App;
